import React from 'react';

import TodoListItem from '../todo-list-item/todo-list-item';

const TodoList = ({ todos }) => {

    const elements = todos.map((item) => {
        return (
            <li>
                <TodoListItem
                    label={item.label}
                    important={item.important} />
            </li>
        )
        console.log({ ...item })
})


return (
    <ul>
        {elements}
    </ul>
)
}

export default TodoList;
